  false,\n\t\"url\": null,\n\t\"notes\": \"This summary of research is in response
  to a lawsuit levied against the U.S. Fish and Wildlife Service by non-governmental
  organizations, a study was initiated by the University of Missouri - Gaylord Labs
  in the spring of 1996 to determine the benefits and impacts of grazing upon vegetation
  and wildlife on the Alamosa/Monte Vista National Wildlife refuges.  As a foundation
  for this multi-year research, vegetative structure, cattle foraging behavior, and
  height/density of the noxious weed tall whitetop grazed and control paddocks for
  the 1996 and 1997 summer grazing seasons were compared.\",\n\t\"license_title\":
